// 서버로 부터 받은 데이터를 내가 원하는 형태로 변경 하는 함수
// {id: , name: } 형식으로 모든 데이터들을 변환
const setContents = (data) => { 
  let list = []

   data.items.forEach((item, index) => {
       list.push({id:item.id, name:item.snippet.title})
   })
   return list;
 }

 export default setContents;
